export default function DevicesIDReducer(state = [], action) {
    switch (action.type) {
      case "FETCH_DEVICES_ID":
        console.log(action.payload)
        // console.log("action.payload")
        return action.payload.devicesID;
  
      default:
        return state;
    }
  };
